paramConversion.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

paramConversion.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0) / (1 - 0);
            return normalizedValue;
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 10 ? 10 : value));
            let normalizedValue = (value - 0) / (10 - 0);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1000 ? 1000 : value));
            let normalizedValue = (value - 0) / (1000 - 0);
            return normalizedValue;
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 2000 ? 2000 : value));
            let normalizedValue = (value - 0) / (2000 - 0);
            return normalizedValue;
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 0.99 ? 0.99 : value));
            let normalizedValue = (value - 0) / (0.99 - 0);
            return normalizedValue;
        }
    case 5:
        {
            value = (value < 0.01 ? 0.01 : (value > 15 ? 15 : value));
            let normalizedValue = (value - 0.01) / (15 - 0.01);
            return normalizedValue;
        }
    case 6:
        {
            value = (value < 0.1 ? 0.1 : (value > 1 ? 1 : value));
            let normalizedValue = (value - 0.1) / (1 - 0.1);
            return normalizedValue;
        }
    default:
        return value;
    }
}

paramConversion.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 2:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1 - 0);
            }
        }
    case 0:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (10 - 0);
            }
        }
    case 1:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (1000 - 0);
            }
        }
    case 4:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (2000 - 0);
            }
        }
    case 3:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0 + value * (0.99 - 0);
            }
        }
    case 5:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.01 + value * (15 - 0.01);
            }
        }
    case 6:
        {
            value = (value < 0 ? 0 : (value > 1 ? 1 : value));

            {
                return 0.1 + value * (1 - 0.1);
            }
        }
    default:
        return value;
    }
}

paramConversion.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 10 ? 10 : (v < 0 ? 0 : v));
            return v;
        }
    case 1:
        {
            v = (v > 1000 ? 1000 : (v < 0 ? 0 : v));
            return v;
        }
    case 2:
        {
            v = (v > 1 ? 1 : (v < 0 ? 0 : v));
            return v;
        }
    case 3:
        {
            v = (v > 0.99 ? 0.99 : (v < 0 ? 0 : v));
            return v;
        }
    case 4:
        {
            v = (v > 2000 ? 2000 : (v < 0 ? 0 : v));
            return v;
        }
    case 5:
        {
            v = (v > 15 ? 15 : (v < 0.01 ? 0.01 : v));
            return v;
        }
    case 6:
        {
            v = (v > 1 ? 1 : (v < 0.1 ? 0.1 : v));
            return v;
        }
    default:
        return value;
    }
}
